import React, { useState } from 'react';
import './Login.css';

const Login = () => {
  const[state, setState] = useState('Admin');
  return (
    <div className='login'>
      <p className='title'><span> {state} </span> Admin </p>
      <form>
        <div>
          <p>Email</p>
          <input name='email' type='email' required/>
        </div>
        <div>
          <p>Password</p>
          <input name='password' type='password' required/>
        </div>
        <button>Login</button>
        {/* {state === 'Admin' ?
        <p className='qst'>Doctor login ? <span onClick={()=>setState('Doctor')}>Click here</span></p>:
        <p className='qst'>Admin login ? <span onClick={()=>setState('Admin')}>Click here</span></p>
        } */}

      </form>
    </div>
  )
}

export default Login
